import Button from "../Button/Button"

const Contador = (props) => {

    const sumar = () => {
        console.log('sumar')
    }
    const restar = () => {
        console.log('restar')
    }
    const reset = () => {
        console.log('reset')
    }

return (
<div>
<h1>{props.titulo}</h1>
<Button label={'+'} operacion={sumar()}/>
<h2>{props.initial}</h2>
<Button label={'-'} operacion={restar()}/>
<Button label={'Reset'} operacion={reset()}/>

</div>
)
}

export default Contador;
